    and information about the refugeu2019s wildlife management objectives, acquisition,
    and public use.  The plan outlines required development on the refuge; areas include:
    water development, habitat development, structures, and recreation.  Refuge equipment
    is also discussed.  Equipment on hand is listed, along with equipment needs.  Finally,
